Jeff Dunham&amp;#039;s Very Special Christmas Special *2008*



Kerstmis zal nooit meer hetzelfde zijn na Jeff Dunham&amp;#039;s DVD &quot;Heel Speciale Kerstmis Speciaal&quot;. Na Youtube te hebben veroverd met zijn fenomeen Achmed De Dode Terrorist, die tien-duizenden DVD&amp;#039;S en ringtones verkoopt, grijpen de komiek en zijn koffer vol poppen Kerstmis aan om u weer een hilarisch avondje te bezorgen. Geniet op deze DVD van de poppen Walter de Mopperige Gepensioneerde, Achmed de Dode Terrorist, Bubba J, Pinda en Jose, die de kerstboom omringen met het geschenken van ononderbrokene lachaanvallen.
